import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Footer = () => (
	<Container
		fluid
		className='bg-dark text-white py-3 mt-5 st'>
		<Row>
			<Col className='text-center'>
				<p className='mb-0'>This is your footer text.</p>
			</Col>
		</Row>
	</Container>
);

export default Footer;
